'  CURSOR cr_apex_file (cp_file_name IN VARCHAR2) IS',
'    SELECT filename  file_name',
'    ,      mime_type',
'    ,      blob_content',
'    ,      DBMS_LOB.GETLENGTH(blob_content) file_size',
'    FROM   apex_application_temp_files',
'    WHERE  name = cp_file_name;',
'  lr_apex_file            cr_apex_file%ROWTYPE;',
'  l_sp_item_id            VARCHAR2(500);',
'',
'BEGIN',
'  -- Get the Uploaded File.',
'  OPEN  cr_apex_file (cp_file_name => :P36_FILE_UPLOAD);',
'  FETCH cr_apex_file INTO lr_apex_file;',
'  CLOSE cr_apex_file;',
'',
'  -- Call API to upload the file to SharePoint',
'  cn_ms_graph_utl_pk.sp_create_file',
'   (p_drive_id    => :P36_SP_DRIVE_ID,',
'    p_folder_path => :P36_PATH,',
'    p_file_name   => lr_apex_file.file_name,',
'    p_mime_type   => lr_apex_file.mime_type,',
'    p_file_blob   => lr_apex_file.blob_content,',
'    x_item_id     => l_sp_item_id);',
'END;'))
,p_process_clob_language=>'PLSQL'
